B.Us=new A.y('W\xe4hlt die betroffene Person w\xe4hrend des Bestellvorgangs in unserem Online-Shop als Zahlungsm\xf6glichkeit "PayPal" aus, werden automatisiert Daten der betroffenen Person an PayPal \xfcbermittelt. Mit der Auswahl dieser Zahlungsoption willigt die betroffene Person in die zur Zahlungsabwicklung erforderliche \xdcbermittlung personenbezogener Daten ein.',null,null,null,null,null,null)
