B.T3=new A.y("12. Rechtsgrundlage der Verarbeitung",null,null,null,null,null,null)
B.TB=new A.y("Art. 6 I lit. a DS-GVO dient unserem Unternehmen als Rechtsgrundlage f\xfcr Verarbeitungsvorg\xe4nge, bei denen wir eine Einwilligung f\xfcr einen bestimmten Verarbeitungszweck einholen. Ist die Verarbeitung personenbezogener Daten zur Erf\xfcllung eines Vertrags, dessen Vertragspartei die betroffene Person ist, erforderlich, wie dies beispielsweise bei Verarbeitungsvorg\xe4ngen der Fall ist, die f\xfcr eine Lieferung von Waren oder die Erbringung einer sonstigen Leistung oder Gegenleistung notwendig sind, so beruht die Verarbeitung auf Art. 6 I lit. b DS-GVO. Gleiches gilt f\xfcr solche Verarbeitungsvorg\xe4nge die zur Durchf\xfchrung vorvertraglicher Ma\xdfnahmen erforderlich sind, etwa in F\xe4llen von Anfragen zur unseren Produkten oder Leistungen. Unterliegt unser Unternehmen einer rechtlichen Verpflichtung durch welche eine Verarbeitung von personenbezogenen Daten erforderlich wird, wie beispielsweise zur Erf\xfcllung steuerlicher Pflichten, so basiert die Verarbeitung auf Art. 6 I lit. c DS-GVO. In seltenen F\xe4llen k\xf6nnte die Verarbeitung von personenbezogenen Daten erforderlich werden, um lebenswichtige Interessen der betroffenen Person oder einer anderen nat\xfcrlichen Person zu sch\xfctzen. Dies w\xe4re beispielsweise der Fall, wenn ein Besucher in unserem Betrieb verletzt werden w\xfcrde und daraufhin sein Name, sein Alter, seine Krankenkassendaten oder sonstige lebenswichtige Informationen an einen Arzt, ein Krankenhaus oder sonstige Dritte weitergegeben werden m\xfcssten. Dann w\xfcrde die Verarbeitung auf Art. 6 I lit. d DS-GVO beruhen. Letztlich k\xf6nnten Verarbeitungsvorg\xe4nge auf Art. 6 I lit. f DS-GVO beruhen. Auf dieser Rechtsgrundlage basieren Verarbeitungsvorg\xe4nge, die von keiner der vorgenannten Rechtsgrundlagen erfasst werden, wenn die Verarbeitung zur Wahrung eines berechtigten Interesses unseres Unternehmens oder eines Dritten erforderlich ist, sofern die Interessen, Grundrechte und Grundfreiheiten des Betroffenen nicht \xfcberwiegen. Solche Verarbeitungsvorg\xe4nge sind uns insbesondere deshalb gestattet, weil sie durch den Europ\xe4ischen Gesetzgeber besonders erw\xe4hnt wurden. Er vertrat insoweit die Auffassung, dass ein berechtigtes Interesse anzunehmen sein k\xf6nnte, wenn die betroffene Person ein Kunde des Verantwortlichen ist (Erw\xe4gungsgrund 47 Satz 2 DS-GVO).",null,null,null,null,null,null)
