B.RU=new A.y("Sie haben das Recht, binnen vierzehn Tagen ohne Angabe von Gr\xfcnden diesen Vertrag zu widerrufen. Die Widerrufsfrist betr\xe4gt vierzehn Tage ab dem Tag, an dem Sie oder ein von Ihnen benannter Dritter, der nicht der Bef\xf6rderer ist, die letzte Ware in Besitz genommen haben bzw. hat. Um Ihr Widerrufsrecht auszu\xfcben, m\xfcssen Sie uns RAUMUNIKATE, Strau\xdfstra\xdfe 27, 89518 Heidenheim, Tel.: 0152 54249392, E-Mail: kontakt@raumunikate.com mittels einer eindeutigen Erkl\xe4rung (z. B. ein mit der Post versandter Brief oder E-Mail) \xfcber Ihren Entschluss, diesen Vertrag zu widerrufen, informieren. Machen Sie von dieser M\xf6glichkeit Gebrauch, so werden wir Ihnen unverz\xfcglich (z. B. per E-Mail) eine Best\xe4tigung \xfcber den Eingang eines solchen Widerrufs \xfcbermitteln. Zur Wahrung der Widerrufsfrist reicht es aus, dass Sie die Mitteilung \xfcber die Aus\xfcbung des Widerrufsrechts vor Ablauf der Widerrufsfrist absenden.",null,null,null,null,null,null)
B.Ts=new A.y("Widerrufsfolgen",null,null,null,null,null,null)
B.Sd=new A.y("Wenn Sie diesen Vertrag widerrufen, haben wir Ihnen alle Zahlungen, die wir von Ihnen erhalten haben, einschlie\xdflich der Lieferkosten (mit Ausnahme der zus\xe4tzlichen Kosten, die sich daraus ergeben, dass Sie eine andere Art der Lieferung als die von uns angebotene, g\xfcnstigste Standardlieferung gew\xe4hlt haben), unverz\xfcglich und sp\xe4testens binnen vierzehn Tagen ab dem Tag zur\xfcckzuzahlen, an dem die Mitteilung \xfcber Ihren Widerruf dieses Vertrags bei uns eingegangen ist. F\xfcr diese R\xfcckzahlung verwenden wir dasselbe Zahlungsmittel, das Sie bei der urspr\xfcnglichen Transaktion eingesetzt haben, es sei denn, mit Ihnen wurde ausdr\xfccklich etwas anderes vereinbart; in keinem Fall werden Ihnen wegen dieser R\xfcckzahlung Entgelte berechnet. Wir k\xf6nnen die R\xfcckzahlung verweigern, bis wir die Waren wieder zur\xfcckerhalten haben oder bis Sie den Nachweis erbracht haben, dass Sie die Waren zur\xfcckgesandt haben, je nachdem, welches der fr\xfchere Zeitpunkt ist. Sie haben die Waren unverz\xfcglich und in jedem Fall sp\xe4testens binnen vierzehn Tagen ab dem Tag, an dem Sie uns \xfcber den Widerruf dieses Vertrags unterrichten, an uns zur\xfcckzusenden oder zu \xfcbergeben. Die Frist ist gewahrt, wenn Sie die Waren vor Ablauf der Frist von vierzehn Tagen absenden. Sie tragen die unmittelbaren Kosten der R\xfccksendung der Waren. Sie m\xfcssen f\xfcr einen etwaigen Wertverlust der Waren nur aufkommen, wenn dieser Wertverlust auf einen zur Pr\xfcfung der Beschaffenheit, Eigenschaften und Funktionsweise der Waren nicht notwendigen Umgang mit Ihnen zur\xfcckzuf\xfchren ist.",null,null,null,null,null,null)
